import React from 'react';
import {Form, Button} from 'react-bootstrap';
export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      cardNumber: '',
      cardExpires: '',
      cardSecureNumber: '',
    };

    this.handleCardNameChange = this.handleCardNameChange.bind(this);
    this.handleCardExpireChange = this.handleCardExpireChange.bind(this);
    this.handleCardSecureNumberChange = this.handleCardSecureNumberChange.bind(this);
    this.handleSubmitCardForm = this.handleSubmitCardForm.bind(this);
  }

  handleCardNameChange(event) {
    this.setState({cardNumber: event.target.value});
  }

  handleCardExpireChange(event) {
    this.setState({carcardExpiresdE: event.target.value});
  }

  handleCardSecureNumberChange(event) {
    this.setState({cardSecureNumber: event.target.value});
  }

  handleSubmitCardForm(event) {
    alert(this.state.cardNumber + this.state.cardExpires + this.state.cardSecureNumber);
    event.preventDefault();
  }

  render() {
    return (
      <div className="App">
        <Form>
  <Form.Group controlId="formBasicEmail">
    <Form.Label>Email address</Form.Label>
    <Form.Control type="email" placeholder="Enter email" />
    <Form.Text className="text-muted">
      We'll never share your email with anyone else.
    </Form.Text>
  </Form.Group>

  <Form.Group controlId="formBasicPassword">
    <Form.Label>Password</Form.Label>
    <Form.Control type="password" placeholder="Password" />
  </Form.Group>
  <Form.Group controlId="formBasicCheckbox">
    <Form.Check type="checkbox" label="Check me out" />
  </Form.Group>
  <Button variant="primary" type="submit">
    Submit
  </Button>
</Form>
      </div>
    );
  }
}
